void MODEL_mkMain::destroy_model()
{
  delete mkMain_instance;
  mkMain_instance = NULL;
}
void MODEL_mkMain::reset_model(bool asserted)
{
  (mkMain_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkMain::get_instance()
{
  return mkMain_instance;
}

/* Fill in version numbers */
void MODEL_mkMain::get_version(unsigned int *year,
			       unsigned int *month,
			       char const **annotation,
			       char const **build)
{
  *year = 0u;
  *month = 0u;
  *annotation = NULL;
  *build = "399b09c";
}

/* Get the model creation time */
time_t MODEL_mkMain::get_creation_time()
{
  
  /* Mon Apr  5 18:20:02 UTC 2021 */
  return 1617646802llu;
}

/* State dumping function */
void MODEL_mkMain::dump_state()
{
  (mkMain_instance->dump_state)(0u);
}

/* VCD dumping functions */
MOD_mkMain & mkMain_backing(tSimStateHdl simHdl)
{
  static MOD_mkMain *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkMain(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkMain::dump_VCD_defs()
{
  (mkMain_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkMain::dump_VCD(tVCDDumpType dt)
{
  (mkMain_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkMain_backing(sim_hdl));
}
